import React from "react";

class temporaryPage extends React.Component {
  render() {
    return (
      <>
        <div className="content">
          <div className="header text-center">
            <h3 className="title">preparing</h3>
          </div>
        </div>
      </>
    );
  }
}

export default temporaryPage;
